define({ 

  //Type your controller code here 

  onNavigate:function(data){
    gblData=data;
    var loadingText = "Loading Pdf...";
    //kony.application.showLoadingScreen(null,loadingText,"center",true,true,null);
    this.view.preShow=this.convertPDF.bind(this);
    this.view.onDeviceBack=this.goBack.bind(this);

  },

  showNotification:function(){
    try{
      controllerReference.view.Popup.isVisible=true;
    }catch(e){}
  },
  
  
  goBack:function(){
    var nav=new kony.mvc.Navigation("contentdetailpage");
    nav.navigate(gblData);
    kony.application.destroyForm("pdfViewer");
  },

  convertPDF:function(){
    controllerReference=this;
    var docPath = kony.io.FileSystem.getDataDirectoryPath();
    var path = docPath.replace("files", "");
    var filePath = path + "/" + gblData.UID + ".pdf";
    var file = new kony.io.File(filePath);
    pdfBase64FromResponse ="data:application/pdf;base64,";
    pdfBase64FromResponse+=kony.convertToBase64(file.read());
    kony.timer.schedule("mytimer12",controllerReference.loadPDF,1, true);

  },
  //The function timerFunc will be executed after every 1 seconds.
  loadPDF:function() //nested function
  {
    kony.print("Enter into timerFunc function() ");	
   // pdfBase64FromResponse ="data:application/pdf;base64,"; 

    this.view.brwPDFContent.evaluateJavaScript("var pdfAsArray = convertDataURIToBinary('" + pdfBase64FromResponse + "');  PDFViewerApplication.open(pdfAsArray);");
    kony.application.dismissLoadingScreen();
    kony.timer.cancel("mytimer12"); 
  }

});